window.bookSummaryJSON = "<p>Darkness almost destroyed the galaxy a thousand years ago. He’s reborn; and Nalini just saved his life. </p> <p>A captive at the mercy of the Warlord of their multi-world kingdom, Nalini has learned to hide under a mask, a lie. As far as her master sees, she’s his obedient little puppet. Then, she meets <i>him</i>. The male who can obliterate the entire Galaxy. Her world ends that day. </p> <p>In the eyes of a young Seer, Kai discovers who he’s meant to be. His future is blood and death; but there’s a female by his side. A female he’d gladly destroy stars for. If his destiny is ruling over ruins with her, so be it. </p> <p>Two souls, worlds apart, under different skies. One destiny. </p> <p><b>Warning: mature content. Strands of Starfire is a space fantasy romance with some explicit scenes. </b> </p> <p><i>Note that this series will only include standalone books.</i></p>"; 
